import React from "react";
import { Text, View } from "react-native";
import repositorios from "../data/repositorios.js";

const RepositoryList = () => {
  return (
    <View>
      {/*Recorremos el arreglo con un map*/}
      {repositorios.map((repo) => (
        //le damos una llave a la vista
        <View key={repo.id}>
          {/*le damos un valor */}
          <Text> {repo.id} </Text>
          <Text> {repo.fullName} </Text>
          <Text> {repo.description} </Text>
          <Text> {repo.language} </Text>
          <Text> {repo.stargazersCount} </Text>
          <Text> {repo.forksCount} </Text>
          <Text> {repo.reviewCount} </Text>
          <Text> {repo.ratingAverage} </Text>
        </View>
      ))}
    </View>
  );
};

export default RepositoryList;
